import { GET_ITEMS, ADD_ITEMS, DELETE_ITEM } from '../actions/types';

const initialState = {
  items: {
    items: [
      { id: uuid(), name: 'brot' },
      { id: uuid(), name: 'Hahnchen' },
      { id: uuid(), name: 'Rindfleisch' },
      { id: uuid(), name: 'sprundel' }
    ]
  }

}
